CREATE DATABASE HovLibrary
GO
USE HovLibrary
GO

CREATE TABLE [Language](
	id						INT				NOT NULL	IDENTITY,
	code					VARCHAR(20)		NOT NULL,
	long_text				VARCHAR(50)		NOT NULL,
	created_at				DATETIME		NOT NULL	DEFAULT CURRENT_TIMESTAMP,
	last_updated_at			DATETIME,
	deleted_at				DATETIME,
	PRIMARY KEY (id),
)

CREATE TABLE Publisher(
	id						INT				NOT NULL	IDENTITY,
	[name]					VARCHAR(200)		NOT NULL,
	created_at				DATETIME		NOT NULL	DEFAULT CURRENT_TIMESTAMP,
	last_updated_at			DATETIME,
	deleted_at				DATETIME,
	PRIMARY KEY (id),
)

CREATE TABLE [Location](
	id						INT				NOT NULL	IDENTITY,
	[name]					VARCHAR(200)	NOT NULL,
	created_at				DATETIME		NOT NULL	DEFAULT CURRENT_TIMESTAMP,
	last_updated_at			DATETIME,
	deleted_at				DATETIME,
	PRIMARY KEY (id),
)

CREATE TABLE Employee(
	id					INT				NOT NULL	IDENTITY,
	[name]				VARCHAR(200)	NOT NULL,
	email				VARCHAR(200)	NOT NULL	UNIQUE,
	[password]			VARCHAR(64)		NOT NULL,
	phone_number		VARCHAR(200)	NOT NULL,
	[address]			VARCHAR(200)	NOT NULL,
	[date_of_birth]		DATE			NOT NULL,
	gender				VARCHAR(10)		NOT NULL,	/*'Male' or 'Female'*/
	created_at			DATETIME		NOT NULL	DEFAULT CURRENT_TIMESTAMP,
	last_updated_at		DATETIME,
	deleted_at			DATETIME,
	PRIMARY KEY (id),
)

CREATE TABLE Member(
	id						INT				NOT NULL	IDENTITY,
	[name]					VARCHAR(200)	NOT NULL,
	phone_number			VARCHAR(200)	NOT NULL,
	email					VARCHAR(200)	NOT NULL,
	city_of_birth			VARCHAR(200)	NOT NULL,
	date_of_birth			DATETIME		NOT NULL,
	[address]				VARCHAR(200)	NOT NULL,
	gender					VARCHAR(50)		NOT NULL,
	created_at				DATETIME		NOT NULL	DEFAULT CURRENT_TIMESTAMP,
	last_updated_at			DATETIME,
	deleted_at				DATETIME,
	PRIMARY KEY (id),
	CONSTRAINT CHK_gender_patient CHECK (gender = 'Male' OR gender = 'Female')
);

CREATE TABLE Book(
	id						INT				NOT NULL	IDENTITY,
	language_id				INT				NOT NULL,
	publisher_id			INT				NOT NULL,
	title					VARCHAR(200)	NOT NULL,
	authors					VARCHAR(200)	NOT NULL,
	isbn					VARCHAR(20)		NOT NULL,
	isbn13					VARCHAR(20)		NOT NULL,
	number_of_pages			INT				NOT NULL,
	publication_date		DATE			NOT NULL,
	ratings_count			INT				NOT NULL,
	average_rating			FLOAT			NOT NULL,
	created_at				DATETIME		NOT NULL	DEFAULT CURRENT_TIMESTAMP,
	last_updated_at			DATETIME,
	deleted_at				DATETIME,
	PRIMARY KEY (id),
	FOREIGN KEY (language_id) REFERENCES [Language](id),
	FOREIGN KEY (publisher_id) REFERENCES Publisher(id),
)

CREATE TABLE BookDetails(
	id						INT				NOT NULL	IDENTITY,
	book_id					INT				NOT NULL,
	location_id				INT				NOT NULL,	
	code					VARCHAR(30)		NOT NULL,
	created_at				DATETIME		NOT NULL	DEFAULT CURRENT_TIMESTAMP,
	last_updated_at			DATETIME,
	deleted_at				DATETIME,
	PRIMARY KEY (id),
	FOREIGN KEY (book_id) REFERENCES Book(id),
	FOREIGN KEY (location_id) REFERENCES [Location](id),
)

CREATE TABLE Borrowing(
	id						INT				NOT NULL	IDENTITY,
	member_id				INT				NOT NULL,
	bookdetails_id			INT				NOT NULL,
	borrow_date				DATETIME		NOT NULL,
	return_date				DATETIME,
	fine					DECIMAL(10,2)				DEFAULT 0,
	created_at				DATETIME		NOT NULL	DEFAULT CURRENT_TIMESTAMP,
	last_updated_at			DATETIME,
	deleted_at				DATETIME,
	PRIMARY KEY (id),
	FOREIGN KEY (member_id) REFERENCES Member(id),
	FOREIGN KEY (bookdetails_id) REFERENCES BookDetails(id),
)

















